Diseases of Ear, Nose and Throat, 5/e is a popular textbook of ENT (Otolaryngology). The first edition of the book was published in 1992. Since then it has received wide acceptance from the market and every attempt has been made to update the current editions in the light of the advances made by the specialty.

The specialty of Otolaryngology: Head and Neck Surgery is fast expanding and has evolved into several super specialties. To keep abreast with these advancements, the current fifth edition of the book was brought out in the market.

